import React, {useState,useEffect } from "react";
import Modal from "react-bootstrap/Modal";
import Button from "react-bootstrap/Button";
import "bootstrap/dist/css/bootstrap.min.css";
import StarRatingComponent from "react-star-rating-component";
import './styles/main.css';
import MovieList from './components/movieList';
import MovieCard from './components/movieCard';


 function Movie (props) {
    const [showsec, setShowsec] = useState(false);
    const handleClosesec = () => setShowsec(false);
    const handleShowsec = () => { 
      setShowsec(true);
    };
    const [keyword, setKeyword] = useState("");
    const [rateSearch, setrateSearch] = useState(1);
    const [newMovie, setnewMovie] = useState({
      name: "",
      pic: "",
      rating: 0,
      year: 0,
    });
    const [movieCard, setmovieCard] = useState({
      name: "Dark Knight",
      pic: "data:image/jpeg;base64,",
      rating: 4,
      year: "2015",
    });
    const [movieList, setmovieList] = useState([
      {
        name: "Dark Knight",
        pic: "data:image/jpeg;base64,",
        rating: 4,
        year: 2015,
      },
      {
        name: "The invisible man",
        pic: "data:image/jpeg;base64,",
        rating: 3,
        year: 2018,
      },
      {
        name: " The Twilight Saga",
        pic: "data:image/jpeg;base64,",
        rating: 5,
        year: 2011,
      },
      {
          name:"Joker",
          pic:"data:image/jpeg;base64,",
          rating:2,
          year:2019

      },
      {
        name:"Avatar",
        pic:"data:image/jpeg;base64,",
        rating:3,
        year:2013

    },
    {
        name:" La casa de papel",
        pic:"data:image/jpeg;base64,",
        rating:4,
        year:2020

    },
    {
        name:"Saw",
        pic:"data:image/jpeg;base64,",
        rating:4,
        year:2010

    },
    {
        name:"Dark",
        pic:"data:image/jpeg;base64,",
        rating:5,
        year:2019

    },


    ]);
    const [show, setShow] = useState(false);
    const handleClose = () => setShow(false);
    const handleShow = () => {
      setShow(true);
    };
    const handleChange = (e) => {
      setnewMovie({ ...newMovie, [e.target.name]: e.target.value });
    };
    const validateMovie = () => {
      setmovieList([...movieList, newMovie]);
      alert("movie added");
      handleClose();
      setnewMovie({ name: "", pic: "", rating: 0, year: 0 });
    };
    const newMovieRatinOk = () => {
      newMovie.rating <= 5
        ? validateMovie()
        : alert("please insert a rate between 0 and 5");
    };
    const addMovie = () => {
      newMovie.name
        ? newMovie.pic
          ? newMovie.rating
            ? newMovie.year
              ? newMovieRatinOk()
          : alert("please insert a year")
            : alert("please insert a rate")
          : alert("please insert a picture URL")
         : alert("please insert a name");
    };
    useEffect(() => {
      document.title = `${movieCard.name}`;
    }, [movieCard]);
    const onStarClick = (nextValue) => {
      setrateSearch(nextValue);
    };
    return (
      <div>
      <div className="container">
        <div className="input-container">
          <label> Search  for a movie </label>
          <input type="text" placeholder="I want to watch ... " 
          onChange={(e) => { setKeyword(e.target.value); }} ></input>
          <Button style={{backgroundColor:"grey" , fontSize:"11px"}} onClick={handleShow}>+</Button>
                <StarRatingComponent 
                  name="searching with stars"
                  starCount={5}
                  value={rateSearch}
                  onStarClick={onStarClick}
                />
              </div>
        
         
     </div>
     <div className="movies-container">
        <MovieList
          setShowsec={(x) => setShowsec(x)}
          rateSearch={rateSearch}
          movieList={movieList.filter((el) =>
            el.name.toUpperCase().includes(keyword.toUpperCase())
          )}
          setmovieCard={(x) => setmovieCard(x)}
        />
      </div>
      <div>
        <MovieCard
          movieCard={movieCard}
          show={showsec}
          setShow={setShowsec}
          handleClose={(x) => handleClosesec(x)}
        />
      </div>
        <div>
          <Modal show={show} onHide={handleClose}>
            <Modal.Header closeButton>
              <Modal.Title >Add Movie</Modal.Title>
            </Modal.Header>
            <Modal.Body>
              <div className="container-fluid row" style={{ display:"block", fontSize:"30px", backgroundColor:"#fff"}}>
                <div > Name </div>
                
                  <input type="text" onChange={handleChange} name="name"></input>
                
                <div >  Picture URL </div>
                
                  <input type="text" onChange={handleChange} name="pic"></input>
                
                <div>  Rate </div>
                 <div>
                  <input
                    type="number"
                    onChange={handleChange}
                    name="rating"
                  ></input>
                </div>
                <div> Year </div>
                <div>
                  <input
                    type="number"
                    onChange={handleChange}
                    name="year"
                  ></input>
                </div>
              </div>
            </Modal.Body>
            <Modal.Footer>
              <Button variant="secondary" onClick={handleClose}>
                Close
              </Button>
              <Button style={{backgroundColor:"grey"}} variant="primary" onClick={addMovie}>
                Add Movie
              </Button>
            </Modal.Footer>
          </Modal>
        </div>
      </div>
    );
  }
  export default Movie;
  